properties.scriptBody:
if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType" != "{p:abcChangeTeamType}") {
	println "This process must be run on a ${p:abcChangeTeamType} environment."
	System.exit(1)
}

// This initializion code is needed to convert the infromation from the UI form to a format that is usable by the action YEAML parser.
String teamName = "${p:abcTeamName}"
String roleNames = "${p:abcRoleNames}"
String addTeamGroups = """${p:abcAddTeamGroups}"""

// Get the team roles list by splitting (by end of line or comma) the groups string supplied from a multi-select list or a text area.
List teamRolesList = roleNames.split(/,|\r?\n/).collect{ /{ team: "$teamName", role: "$it" }/}
println "teamRolesList=$teamRolesList"

// Create a string that represents a team roles JSON array.
String teamRolesJson = "[" + teamRolesList.join(",") + "]"
println "teamRolesJson=$teamRolesJson"

// Set a property to the JSON string.
outProps.put("teamRolesJson", teamRolesJson)

// Get the groups list by splitting (by end of line or comma) the groups string supplied from a multi-select list or a text area.
List addGroupsList = addTeamGroups.split(/,|\r?\n/).collect{ '"' + it + '"'}
println "addGroupsList=$addGroupsList"

// Create a string that represents a groups JSON array.
String addGroupsJson = "[ " + addGroupsList.join(",") + " ]"
println "addGroupsJson=$addGroupsJson"

// Set a property to the JSON string.
outProps.put("addGroupsJson", addGroupsJson)

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "AppTeam") {
	println "This process must be run on an AppTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType" != "{p:abcDeleteTeamType}") {
	println "This process must be run on a ${p:abcDeleteTeamType} environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}") {
	println "This process must be run on an AppTeam or SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType}" != "SuiteTeam") {
	println "This process must be run on a SuiteTeam environment."
	System.exit(1)
}

if (!"${p?:abcTeamType}" || "${p?:abcTeamType" != "{p:abcSendTeamType}") {
	println "This process must be run on a ${p:abcSendTeamType} environment."
	System.exit(1)
}

String propFileName = "UCProcess.props"
String propStr = "${p:application/allProperties},${p:component/allProperties},${p:environment/allProperties},${p:resource/allProperties}"

// Parse the properties
String propertiesFormat = propStr.replaceAll(",", "\n")
Properties properties = new Properties()
properties.load(new StringReader(propertiesFormat))

println "Creating file $propFileName"
new File(propFileName).withWriter { out ->
	properties.each { key, value ->
		// Extra safety to filter out password and token values
		if (!(key ==~ /(i?)^ucadf.*(Password|Pw|Token).*/)) {
			out.println "$key=\"$value\""
		}
	}
}

println "DONE"

String propsFileName = "UCProcess.props"

String targetPropsStr = """${p?:abcTargetProps}"""
String adHocPropsStr = """${p:application/allProperties},${p:component/allProperties},${p:environment/allProperties},${p:resource/allProperties},${p:version/allProperties}"""

// Remove the UrbanCode application prefix from the component name.
String appName = '${p:application.name}'
String compName = '${p:component.name}'
String baseCompName = compName.replaceAll(/^${appName}-(.*)/, '$1')
String utilImageName = ""

// Required properties.
Map<String, String> requiredProps = [
	abcUtilAction:'${p:abcUtilAction}',
	abcSuite:'${p:Initialize/abcSuite}',
	abcInstance:'${p:Initialize/abcInstance}',
	abcAppName:appName,
	abcCompName:compName,
	abcBaseCompName:baseCompName,
	abcComponentVersion:'${p:version.name}'
]

// Parse the properties.
println "Parsing the target properties."
targetPropsStr = targetPropsStr.replaceAll("\n", " ").replaceAll(",", "\n")
Properties targetProps = new Properties()
targetProps.load(new StringReader(targetPropsStr))

println "Parsing the ad-hoc properties."
adHocPropsStr = adHocPropsStr.replaceAll("\n", " ").replaceAll(",", "\n")
Properties adHocProps = new Properties()
adHocProps.load(new StringReader(adHocPropsStr))

println "Creating file $propsFileName."
new File(propsFileName).withWriter { out ->
	// Output the required properties.
	requiredProps.each { key, value ->
		value = value.replaceAll(/'/, "\\\\'")
		out.println "$key='$value'"
	}

	// Output the target properties. Don't display this because there might be secure properties in the string.
	targetProps.each { key, value ->
		if (!requiredProps.containsKey(key)) {
			value = value.replaceAll(/'/, "\\\\'")
			println "$key='***'"
			out.println "$key='$value'"

			if ("abcUtilImageName".equals(key)) {
			    utilImageName = value
			}
		}
	}

	// Output the other properties.	
	adHocProps.each { key, value ->
		// Extra safety to filter out password and token values.
		// Alfo filter out any usage of the required properties.
		if (!requiredProps.containsKey(key) && !targetProps.containsKey(key) && !(key ==~ /(i?)^abc.*(Password|Key|UserId|Pw|Token|ABCManagement|ABCChangeControls).*/)) {
			value = value.replaceAll(/'/, "\\\\'")
			println "$key=\'$value\'"
			out.println "$key='$value'"
		}
	}
}

if (!utilImageName) {
    println "\nERROR: No value found for abcUtilImageName."
    System.exit(0)
}

outProps.put("abcUtilImageName", utilImageName)

println "DONE"

if (!("${p:environment.name}" ==~ /.*${p:abcRequiredEnvType}$/)) {
    println "\nERROR: This process must be run on an environment type with a suffix of ${p:abcRequiredEnvType}.\n"
    System.exit(1)
}
